import React from 'react';

const CallLogTable = ({ callLogs, setCallLogs }) => {
  // Function to delete a single call log entry
  const deleteCallLog = (id) => {
    const confirmDelete = window.confirm('Do you really want to delete this call log?');
    if (confirmDelete) {
      // Call API to delete a single log by ID
      fetch(`/api/calllogs/${id}`, {
        method: 'DELETE',
      })
        .then((res) => res.json())
        .then(() => {
          // Remove deleted call log from the state
          setCallLogs((prevLogs) => prevLogs.filter((log) => log.id !== id));
        })
        .catch((error) => console.error('Error deleting call log:', error));
    }
  };

  return (
    <table className="min-w-full table-auto">
      <thead>
        <tr>
          <th className="px-4 py-2">ID</th>
          <th className="px-4 py-2">Caller</th>
          <th className="px-4 py-2">Time</th>
          <th className="px-4 py-2">Actions</th>
        </tr>
      </thead>
      <tbody>
        {callLogs.map((log) => (
          <tr key={log.id}>
            <td className="border px-4 py-2">{log.id}</td>
            <td className="border px-4 py-2">{log.caller}</td>
            <td className="border px-4 py-2">{log.time}</td>
            <td className="border px-4 py-2">
              <button
                className="bg-red-500 text-white py-1 px-2 rounded hover:bg-red-700"
                onClick={() => deleteCallLog(log.id)}
              >
                Delete
              </button>
            </td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default CallLogTable;
